We cannot wait to see you this Friday December 9th at Bentley for the Winter in Wonderland gala benefiting Project Outreach

Our silent auction is NOW open for everyone to bid! You can go to galabid.com/napleswintergala to register. 
This is open to our gala guests and the public so let’s start Bidding!!

Check in begins at 6:30PM!

We are asking our guests to make this event even more magical for the kids and bring an unwrapped gift for children ages 5-15 valued at $20

Please hand your gifts or any type of donation to our volunteers at the check in area.

Your magical journey begins before you even enter into wonderland at 7PM.

